(50779, '1', 'FR', '111 - La decroissance de l''effectif social est de 3,2% par rapport à l''année dernière. Elle marque un ralentissement par rapport a celle constatee l''annee precedente (5,8% en 2009). Elle s''explique par la poursuite des departs naturels, et notamment les departs en retraite pour les salaries en activite et pour ceux en conges de fin de carriere. Ces departs sont en partie compenses par les recrutements externes et les mobilites venant des filiales du Groupe. Le nombre total de cadres progresse de 1,1% alors que le nombre total de non-cadres decroit de 5%.'),
